import { Typography } from '@mui/material'
import { Box } from '@mui/system'
import React, { useState } from 'react'
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import '../css/FondStyle.css'
import styled from '@emotion/styled';

const StyledBox = styled(Box)({
    '&:hover': {
        color: 'red',
    }
})


function MenuList() {
    const [open, setOpen] = useState(false)
    if(open){
        alert('true')
    }
    return (
        <Box sx={{
            display: 'flex',
            justifyContent: 'space-between',
            gap: 4,
            pt: '0.3rem',
            pr: '3.5rem'
        }}>
            <StyledBox
                onChangeActive={(event, newHover) => {
                    setOpen(true);
                }}
            >
                <Typography >Home<KeyboardArrowDownIcon /></Typography>
            </StyledBox>
            <Box>
                <Typography >Mega Menu<KeyboardArrowDownIcon /></Typography>
            </Box>
            <Box>
                <Typography >Full Screen Menu<KeyboardArrowDownIcon /></Typography>
            </Box>
            <Box>
                <Typography >Pages<KeyboardArrowDownIcon /></Typography>
            </Box>
            <Box>
                <Typography >User Account<KeyboardArrowDownIcon /></Typography>
            </Box>
        </Box>

    )
}

export default MenuList
